  const shellcolor = useStore(state => state.color)
//  const base = new THREE.TextureLoader().load(gold);
 return (
      <mesh  {...props} geometry={nodes.mesh_0.geometry} material={nodes.mesh_0.material} >
          <meshStandardMaterial
